// react
import React, { Component } from 'react';

// third-party
import { NavLink } from 'react-router-dom';

export class NavLinks extends Component {
    render() {
        const links = [
            { title: "General search", url: '/search' },
            { title: "Sent/Received documents", url: '/orders' },
            { title: "Setings", url: '/options' }
        ];

        const linksList = links.map((item, index) => (
            <li key={index} className="nav-links__item">
                <NavLink exact activeClassName="selected" to={item.url}>
                    <span>
                        {item.title}
                    </span>
                </NavLink>
            </li>
        ));

        return (
            <ul className="nav-links nav-links__list">
                {linksList}
            </ul>
        );
    }
}
